function ExpenseItem(props) {
  return (
    <div className="expense-item">
      <div>DATE</div>
      <div className="expense-item__description">
        <h2>
          Tytu≈Ç: {props.title} Title in Expense Item {expenseDate.toISOString()}
        </h2>
        <p>Paragraph w expense item</p>
        <div className="expense-item__price">$12348.98</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
